import React, { Component } from "react";

import "../styles/Pop.scss";

class Popup extends Component {
    render(){

        events = {
            "event": [
                {
                    "event": "Robert attacked Schwartz and won the fight",
                },
                {
                    "event": "Rocky attacked Rockwood and Lost the fight",
                },
                {
                    "event": "Hackers team hacked all PC of police department",
                },
                {
                    "event": "Robert attacked Schwartz and tie the fight",
                },
                {
                    "event": "Robert attacked Schwartz and sattlement the fight",
                }
            ]
        }

        function randomRange(min, max) {
            return Math.floor(Math.random() * (max - min + 1)) + min;
        }

        const listed = events.event.map(function (value, key) {
            const odd = {

                top: this.randomRange(10, 40) + '%',
                right: this.randomRange(10, 40) + '%',
                bottom: this.randomRange(10, 40) + '%'
            }

            const even = {
                left: this.randomRange(50, 100) + '%',
                top: this.randomRange(50, 100) + '%',
                // bottom: Math.floor(Math.random() * 50) + '%'
            }

            return <p key={key} data-tooltip={value.event} style={(key % 2 === 0) ? even : odd} ></p>;
        });

        return [
            <div className='action'>
                {listed}
            </div>
        ];

    }



}

export default Pop;
